import './App.css';
import Auth from './pages/Auth';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <Auth />

       <Routes>
        <Route path="/auth" element={<Auth />} />
      </Routes>
    </div>
  );
} 

export default App;
